import React from 'react'
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

const SliderExample = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1
      };
    return (
        <div>

          <Slider {...settings}>
            <div>
              <h3>1</h3>
            </div>

          </Slider>
        </div>
      );
    }

export default SliderExample
